  //     <Router>
  //         <Routes>
  //           <Route path="/" exact component={LandingPage} />
  //           <Route path="/about" component={AboutPage} />
  //           {/* Add more routes for other pages */}
  //         </Routes>
  //     </Router>

  //     <Footer />
  //   </div>


  <Router>
    <Routes>
        <Route exact path="/" element={<LandingPage />} />
        <Route path="/about" element={<AboutPage />} />
    </Routes>
  </Router>
  );
}

export default App;
